import { useState, useEffect } from "react";

const Import = () => {
  const [IMP, setIMP] = useState(null);

  useEffect(() => {
    const { IMP } = window;
    setIMP(IMP);
  }, []);
  if (IMP !== null) {
    IMP.init("imp37098043");
  }
  return <>import</>;
};

export default Import;
